import React from "react";
import "./style.css";
import Header from "../Header";

function Nav() {
  return (
    <nav>
      <div class="navlinks">
        <a href="#">Log In</a>
        <a href="#">My Profile</a>
      </div>
      <div class="brandlinks">
        <a href="#"><i class="fab fa-twitter"></i></a>
        <a href="#"><i class="fab fa-instagram"></i></a>
      </div>
      
 
    </nav>
  );
}

export default Nav;
